    "2016-07-27T22:54:42.080566",nt"name": "upper-mississippi-river-wildlife-and-fish-refuge-narrative-report-january-february-march-1-1e98f",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Upper Mississippi
    River Wildlife and Fish Refuge outlines Refuge accomplishments from January through
    April of 1958. The report begins by summarizing the weather conditions, habitat
    conditions, water conditions, and food and cover during this period. Wildlife- including
    migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
    mammals, raptors, fish, and disease- is also covered. The Refuge development and
    maintenance section discusses physical developments, plantings, collections and
    receipts, vegetation control, prescribed burning, and wildfires. Resource management
    is outlined; topics include fur harvesting and timber removal. A progress report
    on field investigations and applied research is also provided. The public relations
    section of the report describes recreational uses, Refuge visitors, Refuge participation,
    hunting, fishing, violations, and safety. Items of interest, N-R forms, and photographs
    are attached.Narratives reports for Keithsburg and Louisa Refuges, and Batchtown
    and Calhoun Refuges are attached.",nt"license_title": "License Not Specified",nt"extras":
